children.value:
header {
	display: flex;
	flex-direction: column;
	gap: 1em;
	max-width: min(100%, 68ch);
}
article {
	padding-top: 2em;
	line-height: 1.5;
	display: flex;
	flex-direction: column;
	gap: 1em;
	max-width: 70ch;
}
.banner {
	text-align: center;
	font-size: 1.2rem;
	background: var(--color-light);
	padding: 1em 1.5em;
	padding-left: 0.75em;
	border-radius: 4px;
}

